// src/components/ProfileTabs/ProfileTab.js
import React from 'react';

const ProfileTab = ({ profileData }) => {
  if (!profileData) {
    return <p>Loading...</p>;
  }

  const { progress, actions } = profileData;

  return (
    <div>
      <h2 className="text-xl font-semibold mb-4">Profile Progress</h2>
      <p className="mb-4">Complete your profile and take actions to level up!</p>
      <div className="w-full bg-gray-200 rounded-full h-4 mb-4">
        <div
          className="bg-indigo-600 h-4 rounded-full"
          style={{ width: `${progress}%` }}
        ></div>
      </div>
      <p className="mb-4">{progress}% Complete</p>
      <ul className="list-disc pl-5">
        <li className={actions.customersAdded > 0 ? 'text-green-600' : ''}>
          Add a customer {actions.customersAdded > 0 && '(Completed)'}
        </li>
        <li className={actions.jobsAdded > 0 ? 'text-green-600' : ''}>
          Add a job {actions.jobsAdded > 0 && '(Completed)'}
        </li>
        <li className={actions.jobsCompleted > 0 ? 'text-green-600' : ''}>
          Complete a job {actions.jobsCompleted > 0 && '(Completed)'}
        </li>
      </ul>
    </div>
  );
};

export default ProfileTab;
